import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";

function Footer() {
    return(
        <Navbar bg="dark">
            <Container text-white>
                <h1>Footer</h1>
            </Container>
        </Navbar>
    )
}

export default Footer;
